import React, { useEffect, useState } from 'react'
import axios from "axios";
import Nav from '../Nav';
const UserList = () => {
    const [items, setItems] = useState([]);
 

   


    useEffect(() => {
        loadUsers();
    }, []);

    const loadUsers = async () => {
        const result = await axios.get(`http://localhost:22s00/users`)
        setItems(result.data.reverse());
    }

    
    
   
    return (
        <div>
         <Nav/>

    <div className="about">
                        <h1 className="home_heading">USER LIST</h1>
                        
                         
                        
                        
                        </div>
    <div className="cards">
    {
                items.map((item, index) => (

                        <div key={item.id}>
                       <div className="card">
                         
                        <h3 >{item.email}</h3>
                        
                        </div>
                        </div>
                            
                        
                     
                ))
            }
            </div>
            

 

 
        </div>
    )
}

export default UserList
